import React from 'react'




function Layout() {
  let text_id= document.getElementById("#text")
  const root= document.getElementById("root")
  let text_class =document.getElementsByClassName(".text")
  let text_tag =document.getElementsByTagName("text")
  let text_nstag =document.getElementsByTagName("text")
  let text_name=document.getElementsByName("text")
  const nav = root.firstElementChild
  if(typeof nav.previousSibling !== 'undefined' ){
   console.log(nav.previousSibling.remove())

  }
  console.log("başlangıç")
  console.log(text_id)
  console.log(text_tag)
  console.log(text_nstag)
  console.log(text_name)
  console.log(text_class)
  console.log("bitiş")
  return (
        <>
          <Navbar  />
          <Outlet />
        </>
  )
}

export default Layout
